INSERT INTO `hfa_content` VALUES (37,85,'Hack For Athens | 2014','hack-for-athens','<div class=\"gantry-example\">\r\n<!--<a onclick=\"window.open(this.href+\'&amp;img=images/Hack-For-Athens-FLYER.png&amp;title=Hack_For+Athens&amp;width=800&amp;height=800\',\'Hack%20For%20Athens\',\'scrollbars=yes,resizable=yes,location=yes,menubar=yes,status=yes,toolbar=yes,left=\'+(screen.availWidth/2-400)+\',top=\'+(screen.availHeight/2-400)+\',width=800,height=800\');return false;\" href=\"index.php?option=com_jce&amp;view=popup&amp;tmpl=component\"><img style=\"margin: 10px; float: right;\" src=\"images/Hack-For-Athens-FLYER.png\" alt=\"Hack-For-Athens-FLYER\" width=\"200\" height=\"259\" /></a>-->\r\n<p>The National Day of Civic Hacking will provide citizens an opportunity to do what is most quintessentially American: roll up our sleeves, get involved and work together to improve our society.&nbsp;Web and software developers, designers, community organizers, and other folks from all over Athens will gather to tackle local challenges with technology.</p>\r\n<h4><strong>Solving Real Problems, Helping Real People.</strong></h4>\r\n<p>The event will focus on building technical solutions, but it is not about the technology; its about addressing local problems and challenges. The goal is to produce workable solutions that improve daily life for real people in our communities. The technical solutions we build will be built for a purpose, not just as an exercise.</p>\r\n<h4><strong>Wondering if you should attend? See the flyer to the right to see if you can help.</strong></h4>\r\n<p>Hack for Athens is one of over 77 events happening nationwide as part of the <a href=\"http://hackforchange.org\" target=\"_blank\">National Day of Civic Hacking</a>. The National Day of Civic Hacking is an event during which citizens from around the country will work together with local, state and federal governments as well as private sector organizations with the common goal of improving their community. Hack for Athens is also licensed under <a href=\"http://rhok.org\" target=\"_blank\">Random Hacks of Kindness</a>, an organization started by Microsoft, Yahoo, and NASA, and the World Bank to run hackathons around the world.</p>\r\n</div>\r\n<div class=\"rt-article-title\" style=\"margin-top: 40px; margin-bottom: -60px;\">\r\n<h2>Event Overview</h2>\r\n</div>','',1,16,'2013-02-18 15:28:38',254,'','2014-04-23 18:54:36',254,0,'0000-00-00 00:00:00','2013-02-18 15:28:38','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"0\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',48,1,'','',1,396,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',1,'*',''),(38,91,'Front Page Intro','front-page-intro','<p>-</p>','',1,16,'2013-04-03 23:59:22',254,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','2013-04-03 23:59:22','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,2,'','',1,39,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(39,92,'Sponsorship','sponsorship','<p>-</p>','',1,2,'2013-04-04 01:51:42',254,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','2013-04-04 01:51:42','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,8,'','',1,71,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(40,93,'Challenges','challenges','<p style=\"text-align: center; font-size: 1.8em; line-height: 2em; padding: 0 8em;\">We\'re compiling challenges as we speak, keep checking back in with us, or <a title=\"Submit Your Challenge | Hack For Athens\" href=\"index.php?option=com_b2jcontact&amp;view=b2jcontact&amp;bid=2&amp;Itemid=186\">submit your own challenge</a> for review!</p>\r\n<div class=\"gantry-example\"><a class=\"btn btn-large btn-block btn-primary\" href=\"http://hackforchange.org/2014/index.html#challenges\" target=\"_blank\">View National Challenges Here | National Day of Civic Hacking</a></div>\r\n\r\n<br><br><br>\r\n<span class=\"rt-article-title\"><h2><a href=\"/get-involved/challenges/view-challenges\">Hack For Athens 2013 | Challenges</a></h2></span>\r\n<table class=\"display hackforathens-datatable\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<thead>\r\n<tr><th width=\"300\">Title</th><th>Description</th><th width=\"200\">Contributed By</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td class=\"views-field views-field-title\"><a href=\"index.php?option=com_content&amp;view=article&amp;id=48:safe-drinking-water-challenge&amp;catid=18:challenges\">Safe Drinking Water Challenge</a></td>\r\n<td class=\"views-field views-field-field-description\">This challenge requires participants to create documents containing relevant EPA violation information and statistics that can be given directly to each regulating agency responsible.</td>\r\n<td class=\"views-field views-field-field-performer\">Samuel Bronson | <a href=\"http://epa.gov\">EPA</a></td>\r\n</tr>\r\n<tr>\r\n<td class=\"views-field views-field-title\"><a href=\"index.php?option=com_content&amp;view=article&amp;id=49:athens-affordable-internet-challenge&amp;catid=18:challenges\">Athens Affordable Internet Challenge</a></td>\r\n<td class=\"views-field views-field-field-description\">This challenge will require participants to develop a strategy for providing affordable internet access to low-income neighborhoods within Athens-Clarke county that have low broadband subscription rates.</td>\r\n<td class=\"views-field views-field-field-performer\">Nina Kelly</td>\r\n</tr>\r\n<tr>\r\n<td class=\"views-field views-field-title\"><a href=\"index.php?option=com_content&amp;view=article&amp;id=50:athens-alive-challenge&amp;catid=18:challenges\">Athens Alive Challenge</a></td>\r\n<td class=\"views-field views-field-field-description\">This challenge requires that a visual model for Athens be built that integrates social media into existing information, data, and views.</td>\r\n<td class=\"views-field views-field-field-performer\">Open Block Oakland</td>\r\n</tr>\r\n<tr>\r\n<td class=\"views-field views-field-title\"><a href=\"index.php?option=com_content&amp;view=article&amp;id=51:athens-open-data-portal-challenge&amp;catid=18:challenges\">Open Data Portal Challenge</a></td>\r\n<td class=\"views-field views-field-field-description\">This challenge requires the creation of a system that promotes openness, transparency, and accountability of local government by providing high-value government data in standards compliant, machine readable formats.</td>\r\n<td class=\"views-field views-field-field-performer\">CKAN</td>\r\n</tr>\r\n<tr>\r\n<td class=\"views-field views-field-title\"><a href=\"index.php?option=com_content&amp;view=article&amp;id=52:local-banking-benefits-challenge&amp;catid=18:challenges\">Local Banking Benefits Challenge</a></td>\r\n<td class=\"views-field views-field-field-description\">This challenge requires the creation of an interactive map that conveys that banking locally is not just convenient, but that moving your money to a local bank benefits the community as a whole.</td>\r\n<td class=\"views-field views-field-field-performer\">Becky Sweger</td>\r\n</tr>\r\n<tr>\r\n<td class=\"views-field views-field-title\"><a href=\"index.php?option=com_content&amp;view=article&amp;id=53:athens-openstreetmap-challenge&amp;catid=18:challenges\">Athens OpenStreetMap Challenge</a></td>\r\n<td class=\"views-field views-field-field-description\">This challenge requires the creation of an Athens OpenStreetMap that contains information such as bus routes, bike lanes, etc.</td>\r\n<td class=\"views-field views-field-field-performer\">Jason Woofenden</td>\r\n</tr>\r\n</tbody>\r\n<tfoot>\r\n<tr><th>Title</th><th>Description</th><th>Contributed By</th></tr>\r\n</tfoot>\r\n</table>','',1,2,'2013-04-04 01:54:40',254,'','2014-04-23 18:39:46',254,0,'0000-00-00 00:00:00','2013-04-04 01:54:40','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"0\",\"show_print_icon\":\"0\",\"show_email_icon\":\"0\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',37,7,'','',1,1163,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(41,94,'Datasets','datasets','<div class=\"gantry-example\"><a class=\"btn btn-large btn-block btn-primary\" href=\"http://hackforchange.org/datasets\" target=\"_blank\">View More Datasets Here | National Day of Civic Hacking</a></div>\r\n<table class=\"display hackforathens-datatable\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<thead>\r\n<tr><th width=\"200\">Resource</th><th>Description</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr class=\"odd views-row-first views-row-last\">\r\n<td class=\"views-field views-field-created\"><a href=\"http://www.epa.gov/enviro/facts/sdwis/model.html\" target=\"_blank\">SDWIS Data Model</a></td>\r\n<td class=\"views-field views-field-field-resource\">Contaminant definitions, health effects, and sources of contamination.</td>\r\n</tr>\r\n<tr>\r\n<td class=\"views-field views-field-created\"><a href=\"http://www.epa.gov/enviro/facts/services.html\" target=\"_blank\">Envirofacts API</a></td>\r\n<td class=\"views-field views-field-field-resource\">Envirofacts has developed a RESTful data service API to all of its internal data holdings. This functionality provides a user of Envirofacts with the ability to query any table through the use of a URL.</td>\r\n</tr>\r\n<tr class=\"odd views-row-first views-row-last\">\r\n<td class=\"views-field views-field-created\"><a href=\"http://www.epa.gov/enviro/facts/sdwis/search.html\" target=\"_blank\">SDWIS Geography Search</a></td>\r\n<td class=\"views-field views-field-field-resource\">The Safe Drinking Water Information System (SDWIS) contains information about public water systems and their violations of EPA\'s drinking water regulations, as reported to EPA by the states.</td>\r\n</tr>\r\n<tr>\r\n<td class=\"views-field views-field-created\"><a href=\"http://www.census.gov/hhes/www/poverty/index.html\" target=\"_blank\">US Census Poverty Data</a></td>\r\n<td class=\"views-field views-field-field-resource\">The Census Bureau poverty data reports from several major household surveys and programs.</td>\r\n</tr>\r\n<tr class=\"odd views-row-first views-row-last\">\r\n<td class=\"views-field views-field-created\"><a href=\"http://www.census.gov/main/www/access.html\" target=\"_blank\">US Census Data Access Tools</a></td>\r\n<td class=\"views-field views-field-field-resource\">Data access tools, direct file access to census data, and statistics for, using, or about data collected by the US Census Bureau</td>\r\n</tr>\r\n<tr>\r\n<td class=\"views-field views-field-created\"><a href=\"http://investigativereportingworkshop.org/investigations/broadband-adoption/htmlmulti/broadband-adoption-map/\" target=\"_blank\">Broadband Adoption Rates</a></td>\r\n<td class=\"views-field views-field-field-resource\">Demographic data come from the U.S. Census\' 2005-9 American Community Survey; Broadband adoption is based on the 768Kbps download / 200Kbps upload standard used by the Federal Communications Commission</td>\r\n</tr>\r\n<tr class=\"odd views-row-first views-row-last\">\r\n<td class=\"views-field views-field-created\"><a href=\"http://www.internetessentials.com/\" target=\"_blank\">Comcast Internet Essentials</a></td>\r\n<td class=\"views-field views-field-field-resource\">An affordable service offered by a major internet service provider that includes the option to purchase affordable hardware as well</td>\r\n</tr>\r\n<tr class=\"odd views-row-first views-row-last\">\r\n<td class=\"views-field views-field-created\"><a href=\"http://opencityapps.org/\" target=\"_blank\">Open City App</a></td>\r\n<td class=\"views-field views-field-field-resource\">Open Source projects created by other civic hacking events and groups</td>\r\n</tr>\r\n<tr class=\"odd views-row-first views-row-last\">\r\n<td class=\"views-field views-field-created\"><a href=\"http://www.data.gov/opendatasites\" target=\"_blank\">Data.gov Sites</a></td>\r\n<td class=\"views-field views-field-field-resource\">Open Data Sites containing a wide variety of data sources to be used within the public sector</td>\r\n</tr>\r\n<tr class=\"odd views-row-first views-row-last\">\r\n<td class=\"views-field views-field-created\"><a href=\"http://services.faa.gov/\" target=\"_blank\">FAA Web Services</a></td>\r\n<td class=\"views-field views-field-field-resource\">Federal Aviation Association\'s common framework and documentation for web services</td>\r\n</tr>\r\n<tr class=\"odd views-row-first views-row-last\">\r\n<td class=\"views-field views-field-created\"><a href=\"http://www.opengovtplatform.org/\" target=\"_blank\">Open Government Platform</a></td>\r\n<td class=\"views-field views-field-field-resource\">OGPL is a joint product from India and United States to promote transparency and greater citizen engagement by making more government data, documents, tools and processes publicly available.</td>\r\n</tr>\r\n<tr class=\"odd views-row-first views-row-last\">\r\n<td class=\"views-field views-field-created\"><a href=\"http://nationsreportcard.gov/data_tools.aspx\" target=\"_blank\">The Nation\'s Report Card</a></td>\r\n<td class=\"views-field views-field-field-resource\">The National Assessment of Educational Progress (NAEP) is the largest nationally representative and continuing assessment of what America\'s students know and can do in various subject areas.</td>\r\n</tr>\r\n<tr class=\"odd views-row-first views-row-last\">\r\n<td class=\"views-field views-field-created\"><a href=\"http://www.bls.gov/news.release/laus.nr0.htm\" target=\"_blank\"> Employment Summary </a></td>\r\n<td class=\"views-field views-field-field-resource\">Regional and State Employment and Unemployment Summary</td>\r\n</tr>\r\n\r\n<tr class=\"odd views-row-first views-row-last\">\r\n<td class=\"views-field views-field-created\"><a href=\"http://www.gallup.com/poll/125066/State-States.aspx\" target=\"_blank\"> Gallup State of the States </a></td>\r\n<td class=\"views-field views-field-field-resource\">Gallup poll showing various data and measures across the states for political, economic data sets.</td>\r\n</tr>\r\n\r\n<tr class=\"odd views-row-first views-row-last\">\r\n<td class=\"views-field views-field-created\"><a href=\"https://explore.data.gov/Banking-Finance-and-Insurance/FDIC-Summary-of-Deposits-SOD-Download-File/eq99-z357\" target=\"_blank\"> FDIC Summary of Deposits </a></td>\r\n<td class=\"views-field views-field-field-resource\">The FDIC released data on October 12, 2012 of all branches and their deposit amounts.</td>\r\n</tr>\r\n\r\n<tr class=\"odd views-row-first views-row-last\">\r\n<td class=\"views-field views-field-created\"><a href=\"http://www2.fdic.gov/sod/\" target=\"_blank\"> FDIC Data Dictionary </a></td>\r\n<td class=\"views-field views-field-field-resource\">FDIC information and data dictionary</td>\r\n</tr>\r\n\r\n<tr class=\"odd views-row-first views-row-last\">\r\n<td class=\"views-field views-field-created\"><a href=\"http://researchcu.ncua.gov/Views/FindCreditUnions.aspx\" target=\"_blank\"> National Credit Union Data </a></td>\r\n<td class=\"views-field views-field-field-resource\">The National Credit Union\'s data on all credit unions and their deposits</td>\r\n</tr>\r\n\r\n<tr class=\"odd views-row-first views-row-last\">\r\n<td class=\"views-field views-field-created\"><a href=\"http://hackforchange.org/challenge/bureau-economic-analysis-api-challenge\" target=\"_blank\"> National Credit Union API </a></td>\r\n<td class=\"views-field views-field-field-resource\">Beta API for the Bureau of Economic Analysis.</td>\r\n</tr>\r\n\r\n<tr class=\"odd views-row-first views-row-last\">\r\n<td class=\"views-field views-field-created\"><a href=\"https://admissions.uga.edu/api/\" target=\"_blank\"> UGA Admissions API</a></td>\r\n<td class=\"views-field views-field-field-resource\">WSDL-based API used for retrieving information provided by the UGA Admissions Department.</td>\r\n</tr>\r\n</tbody>\r\n<tfoot>\r\n<tr><th>Resource</th><th>Description</th></tr>\r\n</tfoot>\r\n</table>','',1,2,'2013-04-04 02:00:28',254,'','2013-05-29 02:16:14',254,0,'0000-00-00 00:00:00','2013-04-04 02:00:28','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',36,6,'','',1,738,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(42,97,'Resources','resources','<p>\r\n	New to civic hacking? Dont worry! Well do our best to help match you with a team with diverse skills. If you want to learn more about civic hacking, open data, and design before the event, here are a few links to check out.\r\n</p>\r\n<div class=\"gantry-example\">\r\n	<h2>Hackathon Resources</h2>\r\n	<dl class=\"dl-horizontal large-dt\">\r\n		<dt><a href=\"http://www.rhok.org/\">Random Hacks of Kindness</a></dt>\r\n		<dd>See <a href=\"http://www.rhok.org/solutions\">solutions built at previous RHoK events</a>. Is there anything that could be re-purposed for Athens?</dd>\r\n\r\n		<dt><a href=\"http://codeforamerica.org/projects/\">Code for America apps</a></dt>\r\n		<dd>Code for America has built many open source civic apps.</dd>\r\n\r\n		<dt><a href=\"https://github.com/codeforamerica/civic-tech-patterns\">Civic Tech Patterns</a></dt>\r\n		<dd>Common practices that may help or hinder the conception or design of your civic technology.</dd>\r\n\r\n		<dt><a href=\"http://www.wired.com/opinion/2013/01/hacking-democracy/\">Hacking is Good for Democracy</a></dt>\r\n		<dd>Article by Gavin Newsom on Wired</dd>\r\n\r\n		<dt><a href=\"http://www.whitehouse.gov/blog/2013/01/22/roll-your-sleeves-get-involved-and-get-civic-hacking\">Get Involved, and Get Civic-Hacking</a></dt>\r\n		<dd>The White House call to action</dd>\r\n	</dl>\r\n</div>\r\n\r\n<div class=\"gantry-example\">\r\n<h2>Design Resources</h2>\r\n<dl class=\"dl-horizontal large-dt\">\r\n		<dt><a href=\"http://www.agiledesigners.com/\">Agile Designers</a></dt>\r\n		<dd>collection of resources on design elements, templates, frameworks, icons, fonts, and many other necessary tools for making web projects.</dd>\r\n</dd>\r\n\r\n		<dt><a href=\"http://thenounproject.com/\">Noun Project</a></dt>\r\n		<dd>open source icons</dd>\r\n</dd>\r\n\r\n		<dt><a href=\"http://colorbrewer2.org/\">ColorBrewer</a></dt>\r\n		<dd>planning to color a map? start here!</dd>\r\n</dl>\r\n</div>\r\n<div class=\"gantry-example\">\r\n<h2>Open Data Sources</h2>\r\n<dl class=\"dl-horizontal large-dt\">\r\n		<dt><a href=\"http://www.data.gov/\">Data.gov</a></dt>\r\n		<dd>catalog of data generated by the Federal Government.</dd>\r\n</dd>\r\n\r\n		<dt><a href=\"http://factfinder2.census.gov/faces/nav/jsf/pages/index.xhtml\">American FactFinder</a></dt>\r\n		<dd>data from the U.S. Census Bureau.</dd>\r\n</dd>\r\n\r\n		<dt><a href=\"http://www.census.gov/developers/\">Census Bureau APIs</a></dt>\r\n		<dd>API access to select Census Bureau datasets.</dd>\r\n</dd>\r\n\r\n		<dt><a href=\"http://nationalpriorities.org/en/interactive-data/\">National Priorities Project Data Tools</a></dt>\r\n		<dd>federal spending and tax resources.</dd>\r\n</dd>\r\n\r\n		<dt><a href=\"http://sunlightfoundation.com/projects/\">Sunlight Foundation</a></dt>\r\n		<dd>transparency tools, data, and APIs related to Congressional activities, political contributions, lobbying, and more.</dd>\r\n</dd>\r\n\r\n		<dt><a href=\"http://openstates.org/ma/\">Sunlight Open States (MA)</a></dt>\r\n		<dd>state-level legislative data, also available are <a href=\"http://openstates.org/downloads/\">bulk downloads</a>, an <a href=\"http://openstates.org/api/\">API</a>, and <a href=\"http://python-sunlight.readthedocs.org/en/latest/\">Python API client</a>.</dd>\r\n</dd>\r\n\r\n</dl>\r\n</div>\r\n<div class=\"gantry-example\">\r\n<h2>Developer Resources</h2>\r\n<dl class=\"dl-horizontal large-dt\">\r\n		\r\n		<dt><a href=\"http://d3js.org/\">D3.js</a></dt>\r\n		<dd>a JavaScript library for visualizing data. See <a href=\"http://www.recursion.org/d3-for-mere-mortals/\">D3 for mere mortals</a> to get started.</dd>\r\n</dd>\r\n\r\n		<dt><a href=\"http://www.r-project.org/\">R</a></dt>\r\n		<dd>An open source statistical programming language and community.</dd>\r\n</dd>\r\n\r\n		<dt><a href=\"https://www.enthought.com/products/canopy/\">Enthought Canopy</a></dt>\r\n		<dd>Python data analysis and visualization distribution (Express version is free).</dd>\r\n</dd>\r\n\r\n		<dt><a href=\"http://selection.datavisualization.ch/\">Data Visualization Tools</a></dt>\r\n		<dd>Comprehensive catalog of tools for mapping, charting, and visualizing data.</dd>\r\n</dd>\r\n\r\n		<dt><a href=\"http://flowingdata.com/category/tutorials/\">Flowing Data Tutorials</a></dt>\r\n		<dd>Step-by-step visualization guides. Many are restricted to Flowing Data members, but some are free to the public, and they are excellent.</dd>\r\n</dl>\r\n</div>\r\n<div class=\"gantry-example\">\r\n<h2>Getting, Cleaning, and Analyzing Data</h2>\r\n<dl class=\"dl-horizontal large-dt\">\r\n		<dt><a href=\"http://blog.hartleybrody.com/web-scraping/\">Web Scraping for Fun and Profit</a></dt>\r\n		<dd>A getting-started guide to scraping websites.</dd>\r\n</dd>\r\n\r\n		<dt><a href=\"https://scraperwiki.com/\">ScraperWiki</a></dt>\r\n		<dd>Web-based platform for building programs to extract (scrape) and analyze data from websites.</dd>\r\n</dd>\r\n\r\n		<dt><a href=\"https://github.com/OpenRefine/OpenRefine/wiki\">OpenRefine</a></dt>\r\n		<dd>An open source power tool for cleaning up large, messy datasets.</dd>\r\n</dd>\r\n\r\n		<dt><a href=\"http://mapbox.com/tilemill/\">TileMill</a></dt>\r\n		<dd>An open source design studio from MapBox for making interactive, tiled maps from a variety of data sources (ESRI shapefiles, KML, GeoJSON, CSV, etc.).&nbsp; Integrates with OpenStreetMap.</dd>\r\n</dl>\r\n</div>','',1,2,'2013-04-23 20:18:26',254,'','2013-04-23 20:41:35',254,0,'0000-00-00 00:00:00','2013-04-23 20:18:26','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',12,5,'','',1,624,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(43,98,'Open Source Guidelines','open-source-guidelines','<p>We believe in giving participants the most freedom possible in licensing their work, balanced with the freedom of others to use and adapt technologies to their needs. We require that all projects worked on at Hack for Athens:</p>\r\n<ol>\r\n<li>Are licensed under an <a href=\"http://opensource.org/licenses\"> OSI approved license </a>. While you are free to choose any license, we recommend using one listed as Licenses that are popular and widely used or with strong communities.</li>\r\n<li>Have their code posted on a publicly available code repository. <a href=\"https://github.com/\"> GitHub </a> and <a href=\"https://code.google.com/\"> Google Code </a> are popular choices.</li>\r\n</ol>','',1,2,'2013-04-23 20:50:44',254,'','2013-05-02 20:31:34',254,0,'0000-00-00 00:00:00','2013-04-23 20:50:44','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,4,'','',1,476,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(44,99,'Schedule','schedule','<table class=\"table table-bordered white\">\r\n<thead>\r\n<tr><th>Day</th><th>Time</th><th>Event</th><th>Information</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>Saturday, May 31st</td>\r\n<td>9:00am</td>\r\n<td>Oakbrook Corporate Plaza Opens</td>\r\n<td>Doors open at 9:00am sharp.</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>9:30am - 10:30am</td>\r\n<td>Breakfast</td>\r\n<td>Breakfast is served</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>10:30am - 11:00am</td>\r\n<td>Kickoff First Day</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>11:00am - 1:00pm</td>\r\n<td>Team Formation</td>\r\n<td>Those attending form teams together (optional), select a challenge they wish to solve, then <a href=\"index.php?option=com_chronoforms&amp;view=form&amp;Itemid=195\">submit this information to us</a>.</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>1:00pm - 2:00pm</td>\r\n<td>Lunch and Registration</td>\r\n<td>Team registration and challenge selections due, lunch is served.</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>2:00pm - 5:00pm</td>\r\n<td>Team Work</td>\r\n<td>Teams work on their respective challenges and solutions.</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>5:00pm - 5:30pm</td>\r\n<td>Team Status Update</td>\r\n<td>Q&amp;A for teams who need help from the community (optional)</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>5:30pm - 6:30pm</td>\r\n<td>Team Work</td>\r\n<td>Teams work on their respective challenges and solutions.</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>6:30pm - 7:30pm</td>\r\n<td>Dinner</td>\r\n<td>Dinner is served</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>7:30pm - 8:30pm</td>\r\n<td>Speakers</td>\r\n<td><a href=\"http://mango.ctegd.uga.edu/jkissingLab/\" target=\"_blank\">&nbsp;</a></td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>8:30pm - 10:00pm</td>\r\n<td>Team Work</td>\r\n<td>Teams work on their respective challenges and solutions.</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>10:00pm</td>\r\n<td>End of first day</td>\r\n<td>Doors to the Oakbrook Corporate Plaza are locked at 10:00pm sharp!</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>Sunday, June 1st</td>\r\n<td>9:00am</td>\r\n<td>Oakbrook Corporate Plaza Opens</td>\r\n<td>Doors open at 9:00am sharp.</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>9:30am - 10:30am</td>\r\n<td>Breakfast, Kickoff Second Day</td>\r\n<td>Breakfast, welcome back, brief info session for new participants, introduction for existing teams, event status update</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>10:30am - 1:00pm</td>\r\n<td>Team Work</td>\r\n<td>Teams work on their respective challenges and solutions.</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>1:00pm - 2:00pm</td>\r\n<td>Lunch</td>\r\n<td>Lunch is served, reminder for teams that solutions are due by 6:00pm</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>2:00am - 6:30pm</td>\r\n<td>Team Work</td>\r\n<td>Teams work on their respective challenges and solutions.</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>6:30pm</td>\r\n<td>Pitch Contest Submission</td>\r\n<td>Each team submits their solution and presentation</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>6:30pm - 7:30pm</td>\r\n<td>Dinner</td>\r\n<td>Dinner is served</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>8:00pm - 10:00pm</td>\r\n<td><a href=\"index.php?option=com_content&amp;view=article&amp;id=47&amp;Itemid=201\">Pitch Contest</a></td>\r\n<td>Each team has 5-10 minutes to pitch idea.</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>10:00pm</td>\r\n<td>End of second day</td>\r\n<td>End of event, thank you for helping Hack For Athens! Remember, doors to the Oakbrook Corporate Plaza&nbsp;are locked at 10:00pm sharp!</td>\r\n</tr>\r\n</tbody>\r\n</table>','',1,2,'2013-04-23 20:58:05',254,'','2014-04-16 20:54:01',254,0,'0000-00-00 00:00:00','2013-04-23 20:58:05','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',27,9,'','',1,1103,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(45,100,'Teams','teams','<p style=\"text-align: center; font-size: 1.8em; line-height: 2em; padding: 0 8em;\">We\'re pulling teams together as we speak, <a title=\"Submit Your Challenge | Hack For Athens\" href=\"/get-involved/challenges/submit-challenges/b2jcontact?bid=4\">don\'t forget to submit your team\'s information</a> when you\'re ready!</p>\r\n\r\n<span class=\"rt-article-title\">\r\n	<h2>\r\n					<a href=\"#\"> Last Year\'s Teams</a>\r\n			</h2>\r\n</span>\r\n\r\n\r\n<div class=\"rt-article-title\" style=\"margin-top: 20px;\">\r\n<h2>&nbsp;The Hotdawgs</h2>\r\n</div>\r\n<div class=\"gantry-example\">\r\n<ul>\r\n<li><strong>Challenge Tackled:</strong> <a href=\"index.php?option=com_content&amp;view=article&amp;id=51:athens-open-data-portal-challenge&amp;catid=18:challenges\">Open Data Portal Challenge</a></li>\r\n<li><strong>Synopsis of Solution:</strong>\r\n<p style=\"display: block; margin: 0.5em; text-align: justify;\">We implemented two APIs via Socrata. One provides information about district commissioners and the other gives the district boundaries in latitude and longitude. In addition, we implemented <a href=\"http://hfa-data-portal.herokuapp.com/\" target=\"_blank\">an example app</a> that allows citizens to provide an address and determine their commissioner.</p>\r\n</li>\r\n<li><strong>Team Members</strong>\r\n<ul>\r\n<li><a href=\"http://www.linkedin.com/in/glennstovall\" target=\"_blank\">Glenn Stovall</a></li>\r\n<li><a href=\"http://www.linkedin.com/pub/jonathan-wallace/9/8ba/888\" target=\"_blank\">Jonathan Wallace</a></li>\r\n<li><a href=\"http://www.linkedin.com/in/newellamanda\" target=\"_blank\">Amanda Newell</a></li>\r\n<li><a href=\"http://www.linkedin.com/pub/jennifer-johnson/5a/215/136/\" target=\"_blank\">Jennifer Johnson</a></li>\r\n<li><a href=\"http://www.linkedin.com/pub/alexandria-drake/73/179/3b7\" target=\"_blank\">Alexandria Drake</a></li>\r\n</ul>\r\n</li>\r\n<li><strong>Presentation:</strong> <a href=\"http://bit.ly/1b1abXL\" target=\"_blank\">Open Data Portal Solution | June 2nd, 2013</a></li>\r\n<li><strong>Source Code:</strong> <a href=\"https://github.com/GSto/hfa-open-data#todo\" target=\"_blank\">GitHub Repository</a> <a href=\"https://docs.google.com/a/blackboxoperations.com/document/d/1ZNvKOml8zYpLX-gEJ7OXsmio8GOxlYssKM-fWJQo8oI/edit\">Research Materials</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"rt-article-title\" style=\"margin-top: 20px;\">\r\n<h2>&nbsp;Team Internets</h2>\r\n</div>\r\n<div class=\"gantry-example\">\r\n<ul>\r\n<li><strong>Challenge Tackled:</strong> <a href=\"index.php?option=com_content&amp;view=article&amp;id=49:athens-affordable-internet-challenge&amp;catid=18:challenges\">Athens Affordable Internet Challenge</a></li>\r\n<li><strong>Synopsis of Solution:</strong>\r\n<p style=\"display: block; margin: 0.5em; text-align: justify;\">Our solution to providing low-income areas with affordable broadband internet access relies upon working with businesses and community organisations to create a wireless mesh network to re-invest unused and underutilized bandwidth back into the community.</p>\r\n</li>\r\n<li><strong>Team Members</strong>\r\n<ul>\r\n<li><a href=\"http://www.linkedin.com/in/jordankburke\" target=\"_blank\">Jordan Burke</a></li>\r\n<li><a href=\"http://www.linkedin.com/in/angelkbrown\" target=\"_blank\">Angel Brown</a></li>\r\n<li><a href=\"http://www.linkedin.com/pub/peter-walker/29/253/6a7\" target=\"_blank\">Peter Walker</a></li>\r\n<li><a href=\"http://www.linkedin.com/pub/mike-wilbur/55/632/321\" target=\"_blank\">Mike Wilbur</a></li>\r\n<li><a href=\"http://www.linkedin.com/in/seandeeze\" target=\"_blank\">Sean Dunn</a></li>\r\n</ul>\r\n</li>\r\n<li><strong>Presentation:</strong> <a href=\"media/kunena/attachments/324/affordableinternetpres.pptx\" target=\"_blank\">Affordable Internet | June 2nd, 2013</a></li>\r\n<li><strong>Source Code:</strong> <a href=\"http://github.com/PendragonDevelopment/hack-for-athens\" target=\"_blank\">Affordable Internet GitHub Repository</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"rt-article-title\" style=\"margin-top: 20px;\">\r\n<h2>&nbsp;Comm-unity</h2>\r\n</div>\r\n<div class=\"gantry-example\">\r\n<ul>\r\n<li><strong>Challenge Tackled:</strong> Visualizing Need to Motivate Change</li>\r\n<li><strong>Synopsis of Solution:&nbsp;</strong>\r\n<p style=\"display: block; margin: 0.5em; text-align: justify;\">It is hard to understand the scope of need in Athens as well as communities throughout the country. We have large datasets such as census data and social quality indexes, but they don\'t inform or enable action at the local community level. To affect change requires \"small data,\" that is real-time, geo-located, and communications on a human scale. <em>Comm-unity</em> is a solution that gathers information about needs within the community while delivering help to those who need it from a mobile app. With this information, an open API, and advanced visualizations, various stakeholders will be able directly impact communities across the United States -- as <em>Comm-unity</em> scales efficiently across the existing 211 infrastructure.</p>\r\n</li>\r\n<li><strong>Team Members</strong>\r\n<ul>\r\n<li><a href=\"http://www.linkedin.com/in/travisdouce\" target=\"_blank\">Travis Douce</a></li>\r\n<li><a href=\"http://www.linkedin.com/in/staceylkerr\" target=\"_blank\">Stacey Kerr</a></li>\r\n<li><a href=\"http://www.linkedin.com/pub/ankur-vashi/25/9b/94\" target=\"_blank\">Ankur Vashi</a></li>\r\n<li><a href=\"http://www.linkedin.com/pub/scott-shamp/0/881/60\" target=\"_blank\">Scott Shamp</a></li>\r\n<li><a href=\"http://www.linkedin.com/in/henryoddi\" target=\"_blank\">Henry Oddi</a></li>\r\n<li>Doug Brewer</li>\r\n</ul>\r\n</li>\r\n<li><strong>Presentation:</strong> <a href=\"media/kunena/attachments/305/comm-unity.pptx\" target=\"_blank\">Comm-unity | June 2nd, 2013</a></li>\r\n<li><strong>Source Code:</strong> <a target=\"_blank\">pending</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"rt-article-title\" style=\"margin-top: 20px;\">\r\n<h2>&nbsp;Safe Water Athens</h2>\r\n</div>\r\n<div class=\"gantry-example\">\r\n<ul>\r\n<li><strong>Challenge Tackled:</strong> <a href=\"index.php?option=com_content&amp;view=article&amp;id=48:safe-drinking-water-challenge&amp;catid=18:challenges\">Safe Drinking Water Challenge</a></li>\r\n<li><strong>Synopsis of Solution:</strong>\r\n<p style=\"display: block; margin: 0.5em; text-align: justify;\">Our goal is to build a system that collects information and events from multiple sources to build the story from multiple angles, and shares the story as we know it via web, mobile, and paper. We also want to create a solution that provides opportunities for others to contribute in the future. </p>\r\n</li>\r\n<li><strong>Team Members</strong>\r\n<ul>\r\n<li><a href=\"http://www.linkedin.com/pub/baron-chandler/4/3b9/313\" target=\"_blank\">Baron Chandler</a></li>\r\n<li><a href=\"http://www.linkedin.com/in/csparnicht\" target=\"_blank\">Chris Sparnicht</a></li>\r\n</ul>\r\n</li>\r\n<li><strong>Presentation:</strong> <a href=\"media/Safe Water Athens.ppt\" target=\"_blank\">SafeWater Athens | June 2nd, 2013</a></li>\r\n<li><strong>Source Code:</strong> <a target=\"_blank\">pending</a></li>\r\n</ul>\r\n</div>','',1,2,'2013-04-23 21:23:45',254,'','2014-04-23 20:58:55',254,0,'0000-00-00 00:00:00','2013-04-23 21:23:45','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',30,3,'','',1,962,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(46,101,'Sponsorship Payment','sponsorship-payment','<p>-</p>','',1,2,'2013-04-23 22:04:17',254,'','2013-04-24 01:21:13',254,0,'0000-00-00 00:00:00','2013-04-23 22:04:17','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"0\",\"show_print_icon\":\"0\",\"show_email_icon\":\"0\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',15,2,'','',1,391,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(47,102,'Pitch Contest','pitch-contest','<p class=\"info\">The Pitch Contest held <a href=\"index.php?option=com_content&amp;view=article&amp;id=44&amp;Itemid=193\">after dinner on the final day</a> will allow participants to present their solution for a specific challenge to a panel of judges comprised of business and academic professionals, industry experts, and community leaders.&nbsp;</p>\r\n<div class=\"rt-article-title\" style=\"margin-top: 20px;\">\r\n<h2>&nbsp;Entry and Registration</h2>\r\n</div>\r\n<div class=\"gantry-example\">\r\n<ul>\r\n<li>There is no entry fee.&nbsp;</li>\r\n<li>Entries must be received by <a href=\"index.php?option=com_content&amp;view=article&amp;id=44&amp;Itemid=193\">June 1st at 6:30 PM EST</a>, no exceptions.</li>\r\n<li>Entries may be submitted by individuals or <a style=\"line-height: 1.3em;\" href=\"index.php?option=com_chronoforms&amp;view=form&amp;Itemid=195\">teams</a> <a style=\"line-height: 1.3em;\" href=\"index.php?option=com_users&amp;view=registration&amp;Itemid=166\">registered with Hack For Athens</a>.&nbsp;</li>\r\n<li>Each individual or team may enter one pitch only.&nbsp;</li>\r\n</ul>\r\n</div>\r\n<div class=\"rt-article-title\" style=\"margin-top: 20px;\">\r\n<h2>&nbsp;Pitch Presentations</h2>\r\n</div>\r\n<div class=\"gantry-example\">\r\n<ul>\r\n<li>Pitch presentation must be made by one person alone.</li>\r\n<li>Person presenting will have at most five minutes to present the Pitch.</li>\r\n<li>Pitch must include PowerPoint presentation with no more than three slides.</li>\r\n<li>Any demonstrations involving code or the implementation software used for the idea behind the Pitch must fit within the five minutes allowed for the presentation.&nbsp;</li>\r\n</ul>\r\n</div>\r\n<div class=\"rt-article-title\" style=\"margin-top: 20px;\">\r\n<h2>&nbsp;Judge Deliberation</h2>\r\n</div>\r\n<div class=\"gantry-example\">\r\n<ul>\r\n<li>After presentations have completed, judges will discuss their impressions and observations, comparing each presentation\'s solution according to the scorecard.</li>\r\n<li>The judges will address each team directly about the strengths and weaknesses of their solution.</li>\r\n<li>Disagreements with the judges is fine, but they should be respectful and address the judges point, not the judges personally.</li>\r\n</ul>\r\n</div>\r\n<div class=\"rt-article-title\" style=\"margin-top: 20px;\">\r\n<h2>&nbsp;Prizes</h2>\r\n</div>\r\n<!--<div class=\"gantry-example\">\r\n<ul>\r\n<li><strong>1st Prize</strong>: $250, recognition on all social media channels and newsletters</li>\r\n<li><strong>2nd Prize</strong>: $100, recognition on all social media channels and newsletters</li>\r\n<li><strong>3rd Prize</strong>: $50, recognition on all social media channels and newsletters</li>\r\n<li>Equal shares of any prize money won will be paid to each individual on a winning team.</li>\r\n<li>The individual recipients of prize money will be responsible for the tax implications of their winnings.</li>\r\n</ul>\r\n</div>-->\r\n<div class=\"rt-article-title\" style=\"margin-top: 20px;\">\r\n<h2>&nbsp;Confidentiality and Intellectual Property</h2>\r\n</div>\r\n<div class=\"gantry-example\">\r\n<ul>\r\n<li>The Pitch presentation, code, and other materials comprising the idea behind the Pitch, are considered public domain and will be provided through the Hack For Athens GitHub repository as per our <a href=\"index.php?option=com_content&amp;view=article&amp;id=43&amp;Itemid=199\">Open Source Guidelines</a>.</li>\r\n</ul>\r\n</div>\r\n<div class=\"rt-article-title\" style=\"margin-top: 20px;\">\r\n<h2>&nbsp;Presentation Scorecard</h2>\r\n</div>\r\n<div class=\"gantry-example\">\r\n<ul>\r\n<li>The following areas comprise the scorecard used by the judges during the Pitch Contest presentations.</li>\r\n<li>The scores themselves are graded on a 1-5 scale, where a score of 1 within each area is the lowest, and 5 is the highest.</li>\r\n<li><strong>Impact</strong>: how much impact (quality and quantity) does the solution have on the challenge?</li>\r\n<li><strong>Complexity</strong>: how much progress did the team make during the event? How creative is the solution?</li>\r\n<li><strong>Sustainability</strong>: how good is the team\'s plan for evolving the solution or having another individual, organization, or government evolve the solution?</li>\r\n<li><strong>Presentation</strong>: How well did the team communicate? How well did they respond to questions from the judges? Was the solution to the challenge presented clearly?</li>\r\n</ul>\r\n</div>','',1,2,'2013-05-02 20:46:14',254,'','2014-04-23 18:55:47',254,0,'0000-00-00 00:00:00','2013-05-02 20:46:14','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',28,1,'','',1,726,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(48,106,'Safe Drinking Water Challenge','safe-drinking-water-challenge','<p class=\"info\">The Safe Drinking Water Information System (SDWIS) contains information about public water systems and their violations of EPA\'s drinking water regulations, as reported to EPA by the states. These regulations establish maximum contaminant levels, treatment techniques, and monitoring and reporting requirements to ensure that water systems provide safe water to their customers. This search will help you to find your drinking water supplier and view its violations and enforcement history since 1993.</p>\r\n<div class=\"gantry-example\">\r\n<h2>The Challenge</h2>\r\n<ol>\r\n<li>Within Clarke and Oconee county, what are the different Public Water Systems ( PWS ), the population served by each one, the regulating agency and the contact name and phone number.<ol>\r\n<li>Public Water Systems by county (deprecated)</li>\r\n</ol></li>\r\n<li>Within Clarke and Oconee county, what are the violations and enforcement actions for the different PWSs.<ol>\r\n<li>Violation and enforcement actions by county&nbsp;(deprecated)</li>\r\n</ol></li>\r\n<li>Create a table linking the violations found in pint #2 above with the contaminant definitions, health effects, and sources referrenced by the violation itself.<ol>\r\n<li>Contimnant definitions&nbsp;(deprecated)</li>\r\n<li>Linking health effects data to violation data&nbsp;(deprecated)</li>\r\n</ol></li>\r\n<li>Create documents (.txt, .doc, .docx, or .tex) for all PWSs found to have regulatory violation(s) that:<ol>\r\n<li>Provide the information found in point #2 and #3</li>\r\n<li>Are addressed to the relevant agency/contact found in point #1</li>\r\n<li>Are distinct, such that each PWS should have it\'s own analysis and document</li>\r\n</ol></li>\r\n</ol></div>\r\n<div class=\"gantry-example\">\r\n<h2>The Data</h2>\r\n<ol>\r\n<li><a href=\"http://www.epa.gov/enviro/facts/sdwis/model.html\" target=\"_blank\">SDWIS Data Model</a> - Contaminant definitions, health effects, and sources of contamination</li>\r\n<li><a href=\"http://www.epa.gov/enviro/facts/sdwis/search.html\" target=\"_blank\">SDWIS Geography Search</a> - The Safe Drinking Water Information System (SDWIS) contains information about public water systems and their violations of EPA\'s drinking water regulations, as reported to EPA by the states</li>\r\n<li><a href=\"images/EPA_Safe_Drinking_Water_Challenge_QuickStart_Guide.docx\">QuickStart Guide from EPA</a></li>\r\n</ol></div>','',1,18,'2013-05-21 19:55:29',254,'','2013-06-01 17:47:31',254,0,'0000-00-00 00:00:00','2013-05-21 19:55:29','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"0\",\"show_print_icon\":\"0\",\"show_email_icon\":\"0\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',8,5,'','',1,910,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(49,108,'Athens Affordable Internet Challenge','athens-affordable-internet-challenge','<p class=\"info\">According to the 2010 U.S. Census, over one-third (34.5%) of Athens-Clarke County residents live below the poverty line. Furthermore, <a href=\"images/ACC_20_Poverty_Block_Groups.pdf\" target=\"_blank\">poverty block groups</a> comprise 20% of Athens-Clarke County. We believe that providing affordable, reliable internet connections&nbsp;would increase access to job openings, career opportunities, and training opportunities for unemployed and underemployed citizens. We also believe it would encourage more engagement in local government actions.<br /><br />This challenge will require participants to develop a strategy for providing affordable internet access to low-income neighborhoods within Athens-Clarke county with low broadband subscription rates. Participants are encourage to explore the potential for <a href=\"http://detroitdjc.org/wireless-mesh/\" target=\"_blank\">wireless mesh networking</a> as a possible solution.</p>\r\n<div class=\"gantry-example\">\r\n<h2>The Challenge</h2>\r\n<ol>\r\n<li>Identify the correlation between low-income neighborhoods and low internet subscription rates</li>\r\n<li>Create a strategy for providing internet access to these low-income neighborhoods by:<ol>\r\n<li>Either identifying the most affordable internet connectivity services offered within these poverty block groups through existing internet service providers</li>\r\n<li>Or determining how best to build and support wireless mesh networks in these areas</li>\r\n</ol></li>\r\n<li>Outline an awareness campaign that targets lower income neighborhoods for the purposes of spreading this information</li>\r\n<li>Include local organizations such as <a href=\"http://www.freeitathens.org/\" target=\"_blank\">Free IT Athens</a> and <a href=\"http://communityconnection211.org/\" target=\"_blank\">Community Connection</a> in both the strategy for providing internet access as well as the awareness campaign by:<ol>\r\n<li>Identifying their strengths or relevant services</li>\r\n<li>Create a strategy for integrating said strengths/services</li>\r\n</ol></li>\r\n</ol></div>\r\n<div class=\"gantry-example\">\r\n<h2>The Data</h2>\r\n<ol>\r\n<li><a href=\"http://investigativereportingworkshop.org/investigations/broadband-adoption/htmlmulti/broadband-adoption-map/\" target=\"_blank\">Broadband Adoption Rates</a> - Demographic data come from the U.S. Census\' 2005-9 American Community Survey; Broadband adoption is based on the 768Kbps download / 200Kbps upload standard used by the Federal Communications Commission</li>\r\n<li><a href=\"http://www.internetessentials.com/\" target=\"_blank\">Comcast Internet Essentials</a> - An affordable service offered by a major internet service provider that includes the option to purchase affordable hardware as well</li>\r\n<li><a href=\"http://www.census.gov/hhes/www/poverty/index.html\" target=\"_blank\">US Census Poverty Data</a> - The Census Bureau poverty data reports from several major household surveys and programs</li>\r\n</ol></div>','',1,18,'2013-05-21 19:55:29',254,'','2013-05-29 02:02:33',254,0,'0000-00-00 00:00:00','2013-05-21 19:55:29','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"0\",\"show_print_icon\":\"0\",\"show_email_icon\":\"0\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',9,4,'','',1,1199,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(50,109,'Athens Alive Challenge','athens-alive-challenge','<p class=\"info\">Currently, Map APIs and services such as <a href=\"https://developers.google.com/maps/\" target=\"_blank\">Google Maps</a> provide a wealth of information for local business, such as their address, phone number, local reviews, business description, etc.<br><br>However, the businesses information only tells half the story, and an open source model that integrates social media would allow others to see the business from the Athens citizens\' perspective. This challenge requires that a visual model for Athens be built that integrates social media into existing information, data, and views.</p>\r\n<div class=\"gantry-example\">\r\n<h2>The Challenge</h2>\r\n<ol>\r\n<li>Create a model for Athens that uses social media to enrich the local business districts</li>\r\n<li>Using a mapping service such as <a href=\"https://developers.google.com/maps/\" target=\"_blank\">Google Maps</a>, focus on Athens</li>\r\n<li>Populate the map with local businesses, such as restaurants, retail stores, etc.</li>\r\n<li>Allow users to enable and disable businesses based on their category. For example, the \"Restaurants\" category will be enabled by default, but when disabled all information within the map that pertains to \"Restaurants\" would be hidden or removed</li>\r\n<li>Allow users to log in with their <a href=\"https://developers.facebook.com/docs/reference/apis/\" target=\"_blank\">Facebook</a> and/or <a href=\"https://dev.twitter.com/\" target=\"_blank\">Twitter</a> account</li>\r\n<li>Combine the information within the user\'s social media account, such as photos and posts, with the local businesses so that the business\'s information is paired with Athens citizens\' involvement and experiences</li>\r\n</ol></div>\r\n\r\n<div class=\"gantry-example\">\r\n<h2>The Data</h2>\r\n<ol>\r\n<li><a href=\"https://developers.google.com/maps/\" target=\"_blank\">Google Maps API</a></li>\r\n<li><a href=\"https://developers.facebook.com/docs/reference/apis/\" target=\"_blank\">Facebook API</a></li>\r\n<li><a href=\"https://dev.twitter.com/\" target=\"_blank\">Twitter API</a></li>\r\n</ol></div>','',1,18,'2013-05-21 19:55:29',254,'','2013-05-29 02:02:19',254,0,'0000-00-00 00:00:00','2013-05-21 19:55:29','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"0\",\"show_print_icon\":\"0\",\"show_email_icon\":\"0\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',7,3,'','',1,512,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(51,110,'Athens Open Data Portal Challenge','athens-open-data-portal-challenge','<p class=\"info\">Athens needs a publicly available open data portal in order for Athens to have a basis for the creation of useful civic applications by citizens or third party developers in the future. This challenge requires the creation of a system that promotes openness, transparency, and accountability of local government by providing high-value government data in standards compliant, machine readable formats.</p>\r\n<div class=\"gantry-example\">\r\n<h2>The Challenge</h2>\r\n<ol>\r\n<li>Create a system that promotes openness, transparency, and accountability of local government by providing high-value government data in standards compliant, machine readable formats<ol>\r\n<li>Need help? <a href=\"http://ckan.org/\" target=\"_blank\">Take this idea for example then</a>. What this challenge calls for is adapting to work for Athens and Open Data specifically.</li>\r\n<li>Be creative, Athens is very unique, and a cookie-cutter solution won\'t necessarily solve the challenge!</li>\r\n</ol></li>\r\n<li>Allow for data categorization.<ol>\r\n<li>For example, historical data is different from transportation data, and thus should be in a different category when searching for data as an end-user</li>\r\n</ol></li>\r\n<li>Allow administrators to add data such that each entry has a title, description, and corresponding files in machine readable formats</li>\r\n<li>Data can be searched through by title and description</li>\r\n<li>Data that is added to the platform by an administrator must be verified as Open Data, such that it <a href=\"http://en.wikipedia.org/wiki/Open_data\" target=\"_blank\">satisfies the definition of Open Data</a></li>\r\n</ol></div>\r\n<div class=\"gantry-example\">\r\n<h2>The Data</h2>\r\n<ol>\r\n<li><a href=\"http://www.data.gov/opendatasites\" target=\"_blank\">Data.gov sites and applications</a></li>\r\n<li><a href=\"http://opencityapps.org/\" target=\"_blank\">Open City App</a> - Open Source projects created by other civic hacking events and groups</li>\r\n<li><a href=\"http://www.opengovtplatform.org/\" target=\"_blank\">Open Government Platform</a> - OGPL is a joint product from India and United States to promote transparency and greater citizen engagement by making more government data, documents, tools and processes publicly available</li>\r\n</ol></div>','',1,18,'2013-05-21 19:55:29',254,'','2013-05-29 02:05:42',254,0,'0000-00-00 00:00:00','2013-05-21 19:55:29','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"0\",\"show_print_icon\":\"0\",\"show_email_icon\":\"0\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',5,2,'','',1,870,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(52,111,'Local Banking Benefits Challenge','local-banking-benefits-challenge','<p class=\"info\">Local banks everywhere constantly struggle with educating or informing local citizens of the benefits of buying and banking locally. This challenge requires the creation of an interactive map that conveys that banking locally is not just convenient, but that moving your money to a local bank benefits the community as a whole.</p>\r\n<div class=\"gantry-example\">\r\n<h2>The Challenge</h2>\r\n<ol>\r\n<li>Get the latest deposit data showing the breakdown of money in local banks vs money in national banks</li>\r\n<li>Create a visualization or infographic that conveys the effect of the \"local banking multiplier\"</li>\r\n<li>Essentially, this multiplier means that up to nine times the value of a single local deposit can return to the community in the form of a loan</li>\r\n<li>Display the branches of local banks throughout Athens-Clark County as well as every county immediately surrounding ACC<ol>\r\n<li>One example of this is in&nbsp;<a href=\"http://sonomacounty.golocal.coop/businesses/finance-insurance-and-real-estate/banks-and-credit-unions\" target=\"_blank\">Sonoma County, CA</a></li>\r\n</ol></li>\r\n</ol></div>\r\n\r\n<div class=\"gantry-example\">\r\n<h2>The Data</h2>\r\n<ol>\r\n<li>The FDIC released data on October 12, 2012 of <a href=\"https://explore.data.gov/Banking-Finance-and-Insurance/FDIC-Summary-of-Deposits-SOD-Download-File/eq99-z357\" target=\"_blank\">all bank branches and their deposit amounts</a>. More information and data dictionary <a href=\"http://www2.fdic.gov/sod/\" target=\"_blank\">available here</a></li>\r\n<li>The National Credit Union Administration has <a href=\"http://researchcu.ncua.gov/Views/FindCreditUnions.aspx\" target=\"_blank\">data on credit unions</a> and their deposits</li>\r\n<li>If additional data about personal income, wages, etc. is needed, county-level information is available from the Bureau of Economic Analysis. The Bureau of Economic Analysis, a national sponsor of Hack for Change, has also released <a href=\"http://hackforchange.org/challenge/bureau-economic-analysis-api-challenge\" target=\"_blank\">a beta API</a></li>\r\n</ol>\r\n</div>','',1,18,'2013-05-21 19:55:29',254,'','2013-05-29 02:03:07',254,0,'0000-00-00 00:00:00','2013-05-21 19:55:29','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"0\",\"show_print_icon\":\"0\",\"show_email_icon\":\"0\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',6,1,'','',1,542,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(53,112,'Athens OpenStreetMap Challenge','athens-openstreetmap-challenge','<p class=\"info\">OpenStreetMaps is a collaborative mapping project, built by communities. For example, cyclists add cycleroutes, people adopt the task of mapping whole towns, and volunteer mappers place and edit objects like schools, hospitals, and bus stops, making the maps hyperlocal. After the 2010 Haiti earthquake, OpenStreetMap and Crisis Commons volunteers <a href=\"http://www.nytimes.com/2010/02/04/technology/personaltech/04volunteer.html?_r=0%3Cbr%20/%3E\" target=\"_blank\">used available satellite imagery to map the roads, buildings, and refugee camps of Port-au-Prince in two days</a>, aiding relief efforts.</p>\r\n\r\n<div class=\"gantry-example\"><h2>The Challenge</h2>\r\n<ol>\r\n<li>In 2012, Google Maps started charging high-volume users. Although the charges dont apply to most users, Google can change the terms at any time</li>\r\n<li>As an alternative to Google Maps, this challenge requests the creation of an Athens OpenStreetMap containing the following information (feel free to deviate and add your own if you think it will make for a better solution):\r\n	<ol>\r\n	<li>Athens Transit Bus Routes</li>\r\n	<li>Bike lanes</li>\r\n	<li>Emergency call boxes</li>\r\n	<li>Fire departments and police statements</li>\r\n	</ol>\r\n</li>\r\n<li>Identify other vital resources that you feel would benefit the community if added to the OpenStreetMap, and get them in if you still have time!</li>\r\n</ol>\r\n</div>\r\n\r\n<div class=\"gantry-example\"><h2>The Data</h2>\r\n<ol>\r\n<li><a href=\"https://www.openstreetmap.org/user/new\" target=_blank\">OpenStreetMap Account Creation</a></li>\r\n<li><a href=\"https://josm.openstreetmap.de/\" target=_blank\">Extensible OpenStreetMap editor</a></li>\r\n</ol>\r\n</div>','',1,18,'2013-05-21 19:55:29',254,'','2013-05-29 02:02:49',254,0,'0000-00-00 00:00:00','2013-05-21 19:55:29','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"0\",\"show_print_icon\":\"0\",\"show_email_icon\":\"0\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',4,0,'','',1,525,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
