INSERT INTO `hfa_kunena_messages_text` VALUES (1,'[attachment=6]NationalDayofCivicHacking1.pptx[/attachment]\r\nWelcome!\r\n\r\nThe National Day of Civic Hacking will provide citizens an opportunity to do what is most quintessentially American: roll up our sleeves, get involved and work together to improve our society. Web and software developers, designers, community organizers, and other folks from all over Athens will gather to tackle local challenges with technology.\r\n\r\nSolving Real Problems, Helping Real People.\r\n\r\nThe event will focus on building technical solutions, but it is not about the technology; its about addressing local problems and challenges. The goal is to produce workable solutions that improve daily life for real people in our communities. The technical solutions we build will be built for a purpose, not just as an exercise.\r\n\r\nWondering if you should attend? See the flyer to the right to see if you can help.\r\n\r\nHack for Athens is one of over 77 events happening nationwide as part of the National Day of Civic Hacking. The National Day of Civic Hacking is an event during which citizens from around the country will work together with local, state and federal governments as well as private sector organizations with the common goal of improving their community. Hack for Athens is also licensed under Random Hacks of Kindness, an organization started by Microsoft, Yahoo, and NASA, and the World Bank to run hackathons around the world.'),(12,'https://communities.socrata.com/catalog/ndoch-athens/'),(13,'Hey guys,\r\n\r\nHere\'s a link to the Github repo I set up: [url=http://github.com/PendragonDevelopment/hack-for-athens]Hack for Athens[/url]\r\n\r\nFork or clone as you\'d like, and post your Github username so I can add you as admins/collaborators.'),(15,'Notes:\r\nhttps://docs.google.com/document/d/1QtfaHBaKhbYSMoB4GZDJkteneqlMROgQAK-PoXXk_YU/edit?usp=sharing\r\n\r\nPresentation: https://docs.google.com/presentation/d/1MPMJhxUBgGhy8Bpx_zbuOxrLwGB8iQB-6AcwJDjKPN8/edit?usp=sharing'),(17,'Synopsis of Solution:\r\nIt is hard to understand the scope of need in Athens and communities throughout the country. We have large datasets such as census data and social quality indexes, but they dont inform or enable action at the local community level. To affect change requires small data, that is real-time, geo-located, and communicates on a human scale. Comm-unity is a solution that gathers information about need within the community while delivering help to those who need it from a mobile app. With this information, an open API, and advanced visualization, various stakeholders will be able directly impact communities across the United States -- as Comm-unity scales efficiently across the existing 211 infrastructure.'),(18,'PowerPoint Presentation: Comm-unity  :woohoo:'),(19,':evil: \r\n\r\nGoogle Docs Link: https://docs.google.com/presentation/d/1MPMJhxUBgGhy8Bpx_zbuOxrLwGB8iQB-6AcwJDjKPN8/edit#slide=id.gc7bb25de_038\r\n\r\n\r\n[attachment=3]affordableinternetpres.pptx[/attachment]'),(20,'[attachment=4]SafeWaterAthens.zip[/attachment]\r\nSafe Water Athens - a front end for the epa SWDIS database, with a few extra twists.\r\nCode for web in this example.'),(21,'Our solution to providing low-income areas with affordable broadband internet access relies upon working with businesses and community organisations to create a wireless mesh network to re-invest unused and underutilised bandwidth back into the community.'),(22,'Here\'s the source code for the challenge.');
/*!40000 ALTER TABLE `hfa_kunena_messages_text` ENABLE KEYS */;
UNLOCK TABLES;

