INSERT INTO `hfa_kunena_topics` VALUES (1,2,'Welcome to the HackForAthens forum!',0,0,0,0,1,98,1,0,0,1,1365023956,254,'[attachment=6]NationalDayofCivicHacking1.pptx[/attachment]\r\nWelcome!\r\n\r\nThe National Day of Civic Hacking will provide citizens an opportunity to do what is most quintessentially American: roll up our sleeves, get involved and work together to improve our society. Web and software developers, designers, community organizers, and other folks from all over Athens will gather to tackle local challenges with technology.\r\n\r\nSolving Real Problems, Helping Real People.\r\n\r\nThe event will focus on building technical solutions, but it is not about the technology; its about addressing local problems and challenges. The goal is to produce workable solutions that improve daily life for real people in our communities. The technical solutions we build will be built for a purpose, not just as an exercise.\r\n\r\nWondering if you should attend? See the flyer to the right to see if you can help.\r\n\r\nHack for Athens is one of over 77 events happening nationwide as part of the National Day of Civic Hacking. The National Day of Civic Hacking is an event during which citizens from around the country will work together with local, state and federal governments as well as private sector organizations with the common goal of improving their community. Hack for Athens is also licensed under Random Hacks of Kindness, an organization started by Microsoft, Yahoo, and NASA, and the World Bank to run hackathons around the world.','Kelly Storm',1,1365023956,254,'[attachment=6]NationalDayofCivicHacking1.pptx[/attachment]\r\nWelcome!\r\n\r\nThe National Day of Civic Hacking will provide citizens an opportunity to do what is most quintessentially American: roll up our sleeves, get involved and work together to improve our society. Web and software developers, designers, community organizers, and other folks from all over Athens will gather to tackle local challenges with technology.\r\n\r\nSolving Real Problems, Helping Real People.\r\n\r\nThe event will focus on building technical solutions, but it is not about the technology; its about addressing local problems and challenges. The goal is to produce workable solutions that improve daily life for real people in our communities. The technical solutions we build will be built for a purpose, not just as an exercise.\r\n\r\nWondering if you should attend? See the flyer to the right to see if you can help.\r\n\r\nHack for Athens is one of over 77 events happening nationwide as part of the National Day of Civic Hacking. The National Day of Civic Hacking is an event during which citizens from around the country will work together with local, state and federal governments as well as private sector organizations with the common goal of improving their community. Hack for Athens is also licensed under Random Hacks of Kindness, an organization started by Microsoft, Yahoo, and NASA, and the World Bank to run hackathons around the world.','Kelly Storm',''),(12,2,'A quick way to get an API',0,0,0,0,1,20,0,0,0,12,1370115579,256,'https://communities.socrata.com/catalog/ndoch-athens/','Jonathan Wallace',12,1370115579,256,'https://communities.socrata.com/catalog/ndoch-athens/','Jonathan Wallace',''),(13,7,'Github Repo',0,0,0,0,1,24,0,0,0,13,1370142054,268,'Hey guys,\r\n\r\nHere\'s a link to the Github repo I set up: [url=http://github.com/PendragonDevelopment/hack-for-athens]Hack for Athens[/url]\r\n\r\nFork or clone as you\'d like, and post your Github username so I can add you as admins/collaborators.','Jordan Burke',13,1370142054,268,'Hey guys,\r\n\r\nHere\'s a link to the Github repo I set up: [url=http://github.com/PendragonDevelopment/hack-for-athens]Hack for Athens[/url]\r\n\r\nFork or clone as you\'d like, and post your Github username so I can add you as admins/collaborators.','Jordan Burke',''),(15,7,'Google Docs INfo',0,0,0,0,1,29,0,0,0,15,1370206343,324,'Notes:\r\nhttps://docs.google.com/document/d/1QtfaHBaKhbYSMoB4GZDJkteneqlMROgQAK-PoXXk_YU/edit?usp=sharing\r\n\r\nPresentation: https://docs.google.com/presentation/d/1MPMJhxUBgGhy8Bpx_zbuOxrLwGB8iQB-6AcwJDjKPN8/edit?usp=sharing','Sean Dunn',15,1370206343,324,'Notes:\r\nhttps://docs.google.com/document/d/1QtfaHBaKhbYSMoB4GZDJkteneqlMROgQAK-PoXXk_YU/edit?usp=sharing\r\n\r\nPresentation: https://docs.google.com/presentation/d/1MPMJhxUBgGhy8Bpx_zbuOxrLwGB8iQB-6AcwJDjKPN8/edit?usp=sharing','Sean Dunn',''),(16,8,'Synopsis of Solution:',0,0,0,0,1,96,0,0,0,17,1370208519,306,'Synopsis of Solution:\r\nIt is hard to understand the scope of need in Athens and communities throughout the country. We have large datasets such as census data and social quality indexes, but they dont inform or enable action at the local community level. To affect change requires small data, that is real-time, geo-located, and communicates on a human scale. Comm-unity is a solution that gathers information about need within the community while delivering help to those who need it from a mobile app. With this information, an open API, and advanced visualization, various stakeholders will be able directly impact communities across the United States -- as Comm-unity scales efficiently across the existing 211 infrastructure.','Henry Oddi',17,1370208519,306,'Synopsis of Solution:\r\nIt is hard to understand the scope of need in Athens and communities throughout the country. We have large datasets such as census data and social quality indexes, but they dont inform or enable action at the local community level. To affect change requires small data, that is real-time, geo-located, and communicates on a human scale. Comm-unity is a solution that gathers information about need within the community while delivering help to those who need it from a mobile app. With this information, an open API, and advanced visualization, various stakeholders will be able directly impact communities across the United States -- as Comm-unity scales efficiently across the existing 211 infrastructure.','Henry Oddi',''),(17,8,'Presentation',0,0,0,0,1,9,1,0,0,18,1370213215,305,'PowerPoint Presentation: Comm-unity  :woohoo:','Stacey Kerr',18,1370213215,305,'PowerPoint Presentation: Comm-unity  :woohoo:','Stacey Kerr',''),(18,7,'Presentation Slides',4,0,0,0,2,34,1,0,0,19,1370213408,324,':evil: \r\n\r\nGoogle Docs Link: https://docs.google.com/presentation/d/1MPMJhxUBgGhy8Bpx_zbuOxrLwGB8iQB-6AcwJDjKPN8/edit#slide=id.gc7bb25de_038\r\n\r\n\r\n[attachment=3]affordableinternetpres.pptx[/attachment]','Sean Dunn',21,1370215469,268,'Our solution to providing low-income areas with affordable broadband internet access relies upon working with businesses and community organisations to create a wireless mesh network to re-invest unused and underutilised bandwidth back into the community.','Jordan Burke',''),(19,9,'Source Materials For GitHub',0,0,0,0,1,23,1,0,0,20,1370214810,313,'[attachment=4]SafeWaterAthens.zip[/attachment]\r\nSafe Water Athens - a front end for the epa SWDIS database, with a few extra twists.\r\nCode for web in this example.','Chris Sparnicht',20,1370214810,313,'[attachment=4]SafeWaterAthens.zip[/attachment]\r\nSafe Water Athens - a front end for the epa SWDIS database, with a few extra twists.\r\nCode for web in this example.','Chris Sparnicht',''),(20,9,'Source code',0,0,0,0,1,21,1,0,0,22,1370312430,274,'Here\'s the source code for the challenge.','Baron Chandler',22,1370312430,274,'Here\'s the source code for the challenge.','Baron Chandler','');
